const CarouselItems = [
    {
      item :
           [  {cName : 'd-block w-100'},
              {src : '/images/img1.jpg'},
              {alt : 'First slide'}
            ],
      caption : 'iuuadf'
    },
    {
      item : [
              {cName : 'd-block w-100'},
              {src : '/images/img2.jpg'},
              {alt : 'Second slide'}
            ],
      caption : 'jirkklsfh'
    },
    {
    item : [
            {cName : 'd-block w-100'},
            {src : '/images/img3.jpg'},
            {alt : 'Third slide'}
          ],
    caption : 'jirkklsfh'
  }
]
export default CarouselItems;
